import React, { useState, useEffect } from "react";
import { useParams, useNavigate } from "react-router-dom";
import { useSelector } from "react-redux";

function PhotoDetail() {
  const { photoId } = useParams();
  const [photo, setPhoto] = useState(null);
  const [comments, setComments] = useState([]);
  const [newComment, setNewComment] = useState("");
  const navigate = useNavigate();
  const currentUser = useSelector((state) => state.user);

  useEffect(() => {
    fetchPhotoAndComments();
  }, [photoId]);

  const fetchPhotoAndComments = async () => {
    try {
      const [photoRes, commentsRes] = await Promise.all([
        fetch(`http://localhost:5000/api/photos/${photoId}`, {
          credentials: "include",
        }),
        fetch(`http://localhost:5000/api/photos/${photoId}/comments`, {
          credentials: "include",
        }),
      ]);

      if (!photoRes.ok || !commentsRes.ok) {
        throw new Error("Failed to fetch data");
      }

      const [photoData, commentsData] = await Promise.all([
        photoRes.json(),
        commentsRes.json(),
      ]);

      setPhoto(photoData);
      setComments(commentsData);
    } catch (error) {
      console.error("Error fetching data:", error);
      navigate("/");
    }
  };

  const handleAddComment = async (e) => {
    e.preventDefault();
    if (!newComment.trim()) return;

    try {
      const response = await fetch(
        `http://localhost:5000/api/photos/${photoId}/comments`,
        {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({ comment: newComment }),
          credentials: "include",
        }
      );

      if (!response.ok) {
        throw new Error("Failed to add comment");
      }

      const comment = await response.json();
      setComments([...comments, comment]);
      setNewComment("");
    } catch (error) {
      console.error("Error adding comment:", error);
    }
  };

  if (!photo) {
    return <div className="container mt-5">Loading...</div>;
  }

  return (
    <div className="container mt-5">
      <div className="row">
        <div className="col-md-8">
          <div className="photo-container mb-4">
            <img 
              src={photo.url}
              alt={photo.description || "Photo"}
              className="img-fluid w-100"
            />
          </div>
        </div>

        <div className="col-md-4">
          <div className="photo-info mb-4">
            <div className="photo-meta mb-3">
              <h5>Photo Details</h5>
              <p className="text-muted mb-2">
                By {photo.user_id.first_name} {photo.user_id.last_name}
              </p>
              <p className="text-muted mb-2">
                {new Date(photo.date_time).toLocaleDateString()}
              </p>
              {photo.description && (
                <p className="mb-0">{photo.description}</p>
              )}
            </div>

            <div className="comments-section">
              <h5 className="mb-3">Comments ({comments.length})</h5>
              <div className="comments-list mb-4">
                {comments.map((comment) => (
                  <div key={comment._id} className="comment-item mb-3">
                    <div className="comment-header">
                      <span className="comment-author">
                        {comment.user.first_name} {comment.user.last_name}
                      </span>
                      <span className="comment-date text-muted ms-2">
                        {new Date(comment.date_time).toLocaleDateString()}
                      </span>
                    </div>
                    <p className="comment-text mb-0">{comment.comment}</p>
                  </div>
                ))}
              </div>

              <form onSubmit={handleAddComment}>
                <div className="mb-3">
                  <textarea
                    className="form-control"
                    rows="3"
                    placeholder="Add a comment..."
                    value={newComment}
                    onChange={(e) => setNewComment(e.target.value)}
                    required
                  ></textarea>
                </div>
                <button type="submit" className="btn btn-primary">
                  Post Comment
                </button>
              </form>
              </div>
            </div>
          </div>
        </div>
    </div>
  );
}

export default PhotoDetail;
